import React from 'react';
import { add, sub, mul, div } from './Calc';
function App() {
  return (
    <>
      <ul>
        <li>Sum is {add(20,10)}</li>
        <li>Sub is {sub(20,10)}</li>
        <li>Mul is {mul(20,10)}</li>
        <li>Div is {div(20,10)}</li>
      </ul>
    </>
  );

}

export default App;
